    "SixthFurther" : MessageLookupByLibrary.simpleMessage("Después de la rutina antes de dormir, asegúrate de comenzar el entrenamiento solo cuando el bebé esté somnoliento pero despierto. Asegúrate de que el bebé esté en un ambiente seguro y puedas escucharlo llorar desde fuera de la habitación. Si tienes un monitor para bebés, asegúrate de poder ver al bebé. Pero un monitor para bebés no es esencial para el entrenamiento para dormir. Cada bebé es diferente y especial a su manera. La mayoría tarda de 3 a 7 días en aprender a autoconsolarse, mientras que otros tardan más. El llanto y el tiempo que tarda en dormirse se reducirán notablemente más rápido a medida que pasen los días. Un agradecido padre nos contó que su bebé lloró un total de 16 minutos el primer día, seguido de 8 minutos al día siguiente, 6 minutos al siguiente día, y se durmió en 3 minutos el cuarto día."),
